import faker from 'faker';
import dateformat from 'date-fns/format';

const AGE_MAX = 93;
const SEX_ALLOWED = ['male', 'female'];

function fakenn(birthdate, sex) {
	const yymmdd = Number.parseInt(dateformat(birthdate, 'yyMMdd'), 10);
	const xxx =
		faker.random.number({min: 0, max: 499}) * 2 + (sex === 'male' ? 1 : 0);
	const yymmddxxx = yymmdd * 1000 + xxx;
	const _cd = yymmddxxx % 97;
	const cd = _cd === 0 ? 97 : _cd;
	const yymmddxxxcd = yymmddxxx * 100 + cd;
	const nn = String(yymmddxxxcd).padStart(11, '0');
	return nn;
}

export default function anonymize(document) {
	document.identifier = faker.company.companyName();
	document.reference = String(
		faker.random.number({min: 10000000, max: 99999999})
	);
	document.requestor = faker.name.lastName();

	document.patient.lastname = faker.name.lastName();
	document.patient.firstname = faker.name.firstName();
	document.patient.sex = faker.random.arrayElement(SEX_ALLOWED);
	document.patient.birthdate = faker.date.past(AGE_MAX);
	document.patient.municipality = faker.address.city();
	document.patient.streetandnumber = faker.address.streetAddress();
	document.patient.zip = faker.address.zipCode();
	document.patient.nn = fakenn(
		document.patient.birthdate,
		document.patient.sex
	);

	if (document.mutuality) {
		document.mutuality.id = String(faker.random.number({min: 0, max: 999}));
		document.mutuality.coverage = '';
		document.mutuality.holder = '';
		document.mutuality.kg1 = String(faker.random.number({min: 0, max: 999}));
		document.mutuality.kg2 = String(faker.random.number({min: 0, max: 999}));
	}
}

/**
 * True means always
 * false means never
 * undefined means optional
 * any other type is used as a value
 */
const options = {
	newline: '\n',
	separator: '\\',
	dateFormat: 'ddMMyyyy',
	timeFormat: 'HHmm',
	lang: 'nl',
	end: '',
	nnInA2: true,
	trailing: true
};

export default options;

import mergeWith from 'lodash.mergewith';

function expandOptions(options) {
	const copy = Object.assign({}, options);
	if (
		copy.trailing === undefined ||
		copy.trailing.constructor.prototype !== Object.prototype
	) {
		const value = copy.trailing;
		copy.trailing = {
			A1: value,
			A2: value,
			A3: value,
			A4: value,
			A5: value,
			L1: value,
			L5: value
		};
	}

	return copy;
}

export default function expandAndMergeOptions(...options) {
	return mergeWith({}, ...options.map((x) => expandOptions(x)));
}

import mergeWith from 'lodash.mergewith';

function customizer(objectValue, srcValue) {
	if (Array.isArray(objectValue)) {
		return objectValue.concat(srcValue);
	}
}

export default function insertLine(report, line) {
	return mergeWith({}, report, {source: [line]}, customizer);
}

import mergeWith from 'lodash.mergewith';

function customizer(objectValue, srcValue) {
	if (Array.isArray(objectValue)) {
		return objectValue.concat(srcValue);
	}
}

export default function insertRecord(report, record) {
	let {kind} = report;

	if (record.reference !== report.reference) {
		throw new Error(
			`Invalid record reference '${record.reference}'. Current reference is '${report.reference}'.`
		);
	}

	switch (record.descriptor) {
		case 'L1':
			if (kind === 'report')
				throw new Error(
					`Invalid record descriptor '${record.descriptor}' for a report document.`
				);
			kind = 'lab';
			break;
		case 'L2':
		case 'L3':
		case 'L5':
			if (kind === 'lab')
				throw new Error(
					`Invalid record descriptor '${record.descriptor}' for a lab document.`
				);
			if (
				report.speciality !== undefined &&
				record.speciality !== report.speciality
			) {
				throw new Error(
					`Invalid record speciality '${record.speciality}'. Current speciality is '${report.speciality}'.`
				);
			}

			kind = 'report';
			break;
		default:
			break; // Do nothing
	}

	return {
		...mergeWith({}, report, record, customizer),
		kind
	};
}

