import defaultParseOptions from './defaultParseOptions';
import expandAndMergeOptions from './expandAndMergeOptions';

import parseRecord from './parseRecord';
import insertRecord from './insertRecord';
import insertLine from './insertLine';

export default function parse(string, options) {
	options = expandAndMergeOptions(defaultParseOptions, options);
	const lines = string.match(options.newline);
	return [...parseLines(lines, options)];
}

function* parseLines(lines, options) {
	let report = null;

	for (const [lineno, line] of enumerate(lines, 1)) {
		const parts = line.split(options.separator);

		if (parts.length === 1) {
			if (options.end.constructor.prototype === String.prototype)
				if (parts[0] === options.end) break;
				else if (options.end === undefined) break; // Accept any ending
		}

		if (parts.length < 3) {
			throw new Error(
				`Line ${lineno} consists of less than three parts separated by '\\'`
			);
		}

		const record = parseRecord(parts, options);

		if (record.descriptor === 'A1') {
			if (report !== null) yield sanitizeReport(report);
			report = {...record, source: [line]};
		} else if (report === null) {
			throw new Error(`Document did not start with 'A1\\': ${lineno}`);
		} else {
			report = insertRecord(report, record);
			report = insertLine(report, line);
		}
	}

	if (report !== null) yield sanitizeReport(report);
}

function sanitizeReport(report) {
	if (report.kind === 'lab') {
		return {
			...report,
			anomalies: count(filter((result) => result.flag === '*', report.results))
		};
	}

	return report;
}

import validateLineLength from './validateLineLength';
import validateRequiredField from './validateRequiredField';

export default function parseA1(parts, options) {
	validateLineLength(parts, 'A1', 3, options.trailing.A1);

	validateRequiredField(parts, 'reference', 1);

	const [descriptor, reference, identifier] = parts;

	return {
		descriptor,
		reference,
		identifier
	};
}

import validateLineLength from './validateLineLength';
import validateRequiredField from './validateRequiredField';

import parseSex from './parseSex';
import parseDate from './parseDate';

export default function parseA2(parts, options) {
	validateLineLength(parts, 'A2', [6, 7], options.trailing.A2);

	validateRequiredField(parts, 'lastname', 2);
	validateRequiredField(parts, 'firstname', 3);
	validateRequiredField(parts, 'sex', 4);
	validateRequiredField(parts, 'birthdate', 5);

	const [
		descriptor,
		reference,
		lastname,
		firstname,
		sexstring,
		datestring,
		nn
	] = parts;

	const sex = parseSex(sexstring);
	const birthdate = parseDate(datestring);

	return {
		descriptor,
		reference,
		patient: {
			nn: nn || undefined,
			lastname,
			firstname,
			sex,
			birthdate
		}
	};
}

import validateLineLength from './validateLineLength';

export default function parseA3(parts, options) {
	validateLineLength(parts, 'A3', [2, 3, 4, 5], options.trailing.A3);

	const [
		descriptor,
		reference,
		streetandnumber,
		zip,
		municipality
	] = parts.slice(0, -1);

	return {
		descriptor,
		reference,
		patient: {
			streetandnumber,
			zip,
			municipality
		}
	};
}

import validateLineLength from './validateLineLength';
import validateRequiredField from './validateRequiredField';

import parseDateTime from './parseDateTime';
import parseStatus from './parseStatus';

export default function parseA4(parts, options) {
	validateLineLength(parts, 'A4', 6, options.trailing.A4);
	validateRequiredField(parts, 'date', 4);

	const [descriptor, reference, requestor, date, time, statusString] = parts;

	const datetime = parseDateTime(date, time);
	const status = parseStatus(statusString);

	return {
		descriptor,
		reference,
		requestor,
		datetime,
		status
	};
}

import validateLineLength from './validateLineLength';

export default function parseA5(parts, options) {
	validateLineLength(parts, 'A5', [7, 8], options.trailing.A5);

	const [descriptor, reference, id, nn, coverage, holder, kg1, kg2] = parts;

	return {
		descriptor,
		reference,
		mutuality: {
			id,
			coverage,
			holder,
			kg1,
			kg2
		},
		patient: {
			nn
		}
	};
}

