import parseA1 from './parseA1';
import parseA2 from './parseA2';
import parseA3 from './parseA3';
import parseA4 from './parseA4';
import parseA5 from './parseA5';

import parseL1 from './parseL1';
import parseL5 from './parseL5';

export default function parseRecord(parts, options) {
	let [descriptor, ...rest] = parts;
	descriptor = parts[0].trim(); // To remove <feff> byte order mark
	parts = [descriptor, ...rest];

	switch (descriptor) {
		case 'A1':
			return parseA1(parts, options);
		case 'A2':
			return parseA2(parts, options);
		case 'A3':
			return parseA3(parts, options);
		case 'A4':
			return parseA4(parts, options);
		case 'A5':
			return parseA5(parts, options);
		case 'L1':
			return parseL1(parts, options);
		case 'L2':
		case 'L3':
		case 'L5':
			return parseL5(parts, options);
		default:
			throw new Error(`Unknown record descriptor '${descriptor}'`);
	}
}

export default function parseSex(letter) {
	switch (letter) {
		case 'F':
		case 'V':
			return 'female';
		case 'M':
			return 'male';
		default:
			return 'other';
	}
}

export default function parseStatus(letter) {
	switch (letter) {
		case 'P':
			return 'partial';
		case 'C':
			return 'complete';
		default:
			return 'unknown';
	}
}

import getYear from 'date-fns/getYear';

export default function sliceDate(datestring) {
	const day = datestring.slice(0, 2);
	const month = datestring.slice(2, 4);
	let year = datestring.slice(4, 8);
	if (year.length === 2) {
		const yearNumber = Number.parseInt(year, 10);
		const now = new Date();
		const thisYear = getYear(now);
		const cutOff = thisYear % 100;
		// The logic is that dates can only be in the past with
		// those documents
		// stops working 01 Jan 2100
		// hopefully I'll be dead by then
		if (yearNumber <= cutOff) {
			year = `20${year}`;
		} else {
			year = `19${year}`;
		}
	}

	return {year, month, day};
}

export default function sliceTime(timestring) {
	const hour = timestring.slice(0, 2);
	const minute = timestring.slice(2, 4);

	return {hour, minute};
}

