﻿export default function* stringifyL5(record, options) {
	const {reference, speciality, text} = record;

	for (const line of text) {
		const parts = ['L5', reference, speciality, '', '', '', '', line];

		if (options.trailing.L5) parts.push('');

		yield parts;
	}
}

import stringifyA1 from './stringifyA1';
import stringifyA2 from './stringifyA2';
import stringifyA3 from './stringifyA3';
import stringifyA4 from './stringifyA4';
import stringifyA5 from './stringifyA5';

import stringifyL1 from './stringifyL1';
import stringifyL5 from './stringifyL5';

export default function* stringifyRecord(record, options) {
	yield stringifyA1(record, options);
	yield stringifyA2(record, options);
	yield stringifyA3(record, options);
	yield stringifyA4(record, options);
	if (record.mutuality) yield stringifyA5(record, options);

	switch (record.kind) {
		case 'lab':
			yield* stringifyL1(record, options);
			break;
		case 'report':
			yield* stringifyL5(record, options);
			break;
		default:
			throw new Error(`Unknown record kind '${record.kind}'`);
	}
}

export default function stringifySex(sex, options) {
	switch (sex) {
		case 'female':
			return options.lang === 'nl' ? 'V' : 'F';
		case 'male':
			return 'M';
		default:
			return '';
	}
}

export default function stringifyStatus(status) {
	switch (status) {
		case 'partial':
			return 'P';
		case 'complete':
			return 'C';
		default:
			return '';
	}
}

import dateFormat from 'date-fns/format';
import dateParseISO from 'date-fns/parseISO';

export default function stringifyTime(datestring, options) {
	const date =
		datestring instanceof Date ? datestring : dateParseISO(datestring);
	const timeString = dateFormat(date, options.timeFormat);

	return timeString === '0000' ? '' : timeString;
}

export default function validateLineLength(
	parts,
	kind,
	validLengths,
	trailingSlash
) {
	if (typeof validLengths === 'number') validLengths = [validLengths];
	let validLengthsWithTrailingSlash =
		trailingSlash === false ? [] : validLengths.map((x) => x + 1);
	validLengths = trailingSlash === true ? [] : validLengths;
	validLengths = new Set(validLengths);
	validLengthsWithTrailingSlash = new Set(validLengthsWithTrailingSlash);

	const isValidLength = validLengths.has(parts.length);
	const isValidLengthWithTrailingSlash = validLengthsWithTrailingSlash.has(
		parts.length
	);

	if (!isValidLength && !isValidLengthWithTrailingSlash) {
		const expectedLengths = [
			...new Set([...validLengths, ...validLengthsWithTrailingSlash])
		];
		expectedLengths.sort();
		const expected = `any of ${JSON.stringify(expectedLengths)}`;
		throw new Error(
			`parse${kind}: wrong number of parts, got ${parts.length}, expected ${expected}.`
		);
	}

	if (
		trailingSlash === true ||
		(isValidLengthWithTrailingSlash && !isValidLength)
	) {
		// Last part MUST be empty
		const last = parts.length - 1;
		if (parts[last].trimStart() !== '') {
			throw new Error(
				`parse${kind}: wrong last part, got ${parts[last]}, expected ''.`
			);
		}
	}
}

export default function validateRequiredField(parts, name, position) {
	if (parts[position - 1] === '') {
		throw new Error(
			`Request ${name} is a required field on position ${position}`
		);
	}
}

